window.bookSummaryJSON = "<p><b>DEAD END RETURNS</b></p> <p>Contact tablets and teleportation circles across the world have stopped functioning. Now, Rudeus and his allies gather at the Superd village, where a powerful subjugation patrol aims to take them out. The third North God Kalman, the former Sword God Gal Farion, and the Ogre God Marta march among their ranks. Rudeus's team puts their lives on the line in this ultimate clash of the world's most mighty warriors!</p>"; 
